window.bookSummaryJSON = "<p>Bran wakes in Neuroma, but has no idea what happened the previous night. He continues to progress through Office Wars while secrets start unraveling everything he thought he knew. Some secrets could destroy everything, while others open new paths. What future path will Bran's secrets reveal?</p> <p>Vicky returns, but is she who Bran thought she was?&nbsp;</p> <p>Plenty of laughs, more introspection, and a conclusion to this season of Office Wars inside. Do not worry, you will see Bran and friends in future series. All Odditek Online series operate in the same multiverse, you might even get a few hints at other stories that I'm writing or have written.</p>"; 
